                      />
                    </div>

                    <button
                      style={{
                        width: "100%",
                        borderRadius: 20,
                        background: " #001E33",
                        height: 40,
                        color: "#FFFFFF",
                        fontSize: 18,
                        borderColor: "transparent",
                      }}
                      onClick={() => setScreen("3")}
                    >
                      {REGI01_box1EN[12].label}
                    </button>
                  </div>
                </div>
              ) : Doc === "Thai" ? (
                <div>
                  <div
                    style={{
                      position: "fixed",
                      top: 20,
                      left: width * 0.59,
                      textAlign: "-webkit-center",
