                        border: "none",
                      }}
                      onClick={() => goHome(Doc)}
                    >
                      <p id={"Hometext"}>{REGI01_box1TH[0].label}</p>
                      <BsArrowLeftShort id={"Hometext2"} />
                    </div>

                    <button
                      style={{
                        fontWeight: 400,
                        textAlign: "right",
                        marginBottom: 20,
                        float: "right",
