                          padding: 20,
                          paddingLeft: 12,
                          margin: 10,
                          fontSize: 13,
                        }}
                      />
                    </div>

                    <div style={{ textAlign: "left" }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1TH[6].label}
                      </p>
                      <input
                        type="text"
                        name="user_email"
                        // value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        placeholder={REGI01_box1TH[7].label}
                        style={{
                          background: "#FFFFFF",
                          border: "1px solid #F1F1F1",
                          borderRadius: 20,
                          width: "100%",
                          height: 30,
                          padding: 20,
                          paddingLeft: 12,
                          margin: 10,
                          fontSize: 13,
                        }}
                      />
                    </div>

                    <div style={{ textAlign: "left" }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1TH[8].label}
                      </p>

                      <input
                        type={type}
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        placeholder={REGI01_box1TH[9].label}
                        style={{
                          background: "#FFFFFF",
                          border: "1px solid #F1F1F1 ",
